import React from "react";

class Region extends React.Component{
    constructor(props) {
        super(props);
        this.props = props;
    }

    render() {
        return(
            <g>
                <rect id="svg_1" height="10" width="10" y="59" x="107.5" stroke-width="1" stroke="#000" fill="#fff"/>
                <path fill={this.props.data.color} d={this.props.data.d}/>
            </g>
        );
    }
}
export default Region;
